    return(
        <div className="cnt_wrap">
            <div className="cnt">
                <div className="cnt_tit">이 홈페이지에 대하여..</div>
                <div className="tit_line"></div>
                <div className="cnt_sub_tit">HJY's Portfolio</div>
                <div className="cnt_sec main_sec">
                    <div className="text_area">
                        포트폴리오를 만들 계획을 하던중,<br/>흔하고 화려한 포트폴리오가 아닌, 친숙하고 깔끔한 디자인을
                        계획했습니다.<br/> 그리하여 디자인 시작.
                    </div>
                    <div dangerouslySetInnerHTML={{ __html: "<iframe style='border: 1px solid rgba(0, 0, 0, 0.1); margin-top:30px;' width='100%' height='450px' src='https://www.figma.com/embed?embed_host=share&url=https%3A%2F%2Fwww.figma.com%2Ffile%2FdwJcOkbVxk5F0HqIv46HxW%2FDomi_Page' allowfullscreen/>"}} />
                    <div className="text_area">
                        포트폴리오를 만들 계획을 하던중,<br/>흔하고 화려한 포트폴리오가 아닌, 친숙하고 깔끔한 디자인을
                        계획했습니다.<br/> 그리하여 디자인 시작.
                    </div>
                </div>
            </div>
        </div>
    )
    
}

export default Main;
